// main.js

import Vue from 'vue';
import App from './App.vue';
import router from './router';
import DisplayData from './components/DisplayData.vue'; // Import your DisplayData.vue component

Vue.config.productionTip = false;

new Vue({
  router,
  components: {
    DisplayData // Register the DisplayData component
  },
  render: h => h(App)
}).$mount('#app');
